import React from "react";
import "./Table.css";
import numeral from "numeral";
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import TablePagination from '@mui/material/TablePagination';

function TableS({ countries }) {
  return (
    <div className="table">
      <TableContainer>
        <Table>
        <TableHead>
        <TableRow>
            <TableCell align="center">COUNTRIES</TableCell>
            <TableCell align="center">POPULATION</TableCell>
            <TableCell align="center">TOTAL NO OF CASES</TableCell>
            <TableCell align="center">ACTIVE CASES</TableCell>
            <TableCell align="center">RECOVERED CASES</TableCell>
            <TableCell align="center">DEATH CASES</TableCell>
          </TableRow>
        </TableHead>

          <TableBody>
          {countries.map((country, i) => (
            <TableRow key={i}>
              <TableCell align="center">
              {country.country}
              </TableCell>
              <TableCell align="center">
              {numeral(country.population).format("0,0")}
              </TableCell>
              <TableCell align="center">
              {numeral(country.cases).format("0,0")}
              </TableCell>
              <TableCell align="center">
              {numeral(country.active).format("0,0")}
              </TableCell>
              <TableCell>
              {numeral(country.recovered).format("0,0")}
              </TableCell>
              <TableCell align="center">
              {numeral(country.deaths).format("0,0")}
              </TableCell>
            </TableRow>
             ))}
          </TableBody>
        </Table>
      </TableContainer>
    </div>
  );
}

